    "2016-07-27T22:46:18.165046",nt"name": "horicon-national-wildlife-refuge-narrative-report-for-period-january-february-march-and-ap",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1950.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, and wildfires. Resource management is outlined; topics include grazing,
    timber harvesting, and fur harvesting. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and violations.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
